import React from 'react'
import style from './home.module.css'
import first_pic from '../../Pictures/logo.png'

const Home = () => {
    return(
        <body>
            <div className={`${style.first_story}`}>
                <span className={`${style.story}`}></span>
                <img src={first_pic} alt="Mykhailo Hryshevsky" />
            </div>
        </body>
    )
}

export default Home;
